import React, { useState } from "react";
import {
	AppBar,
	Box,
	Toolbar,
	Typography,
    Button,
    IconButton,
	Grid
} from "@material-ui/core";
import {LibraryMusic, QueueMusic} from '@material-ui/icons';
import LoginIcon from '@mui/icons-material/Login';
import LogoutIcon from '@mui/icons-material/Logout';
import SearchConcert from "./SearchConcert";

const Navbar = () => {
    const [currentPage, setCurrentPage] = React.useState(0);
    const [auth, setAuth] = React.useState(false);

	return (
        <Box sx={{ flexGrow: 1 }}>
          <AppBar position="static">
            <Toolbar>
                {!auth && (
                    <IconButton
                        size="large"
                        aria-label="account of current user"
                        aria-controls="menu-appbar"
                        aria-haspopup="true"
                        color="inherit"
                    >
                        <LibraryMusic />
                    </IconButton>
                )}
                {auth && (
                    <IconButton
                        size="large"
                        aria-label="account of current user"
                        aria-controls="menu-appbar"
                        aria-haspopup="true"
                        onClick={() => setCurrentPage(1)}
                        color="inherit"
                    >
                        <QueueMusic />
                    </IconButton>
                )}
                <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
                    CS411 Music World!
                </Typography>
                {!auth && (
                    <IconButton
                        size="large"
                        aria-label="account of current user"
                        aria-controls="menu-appbar"
                        aria-haspopup="true"
                        onClick={() => setCurrentPage(1)}
                        color="inherit"
                    >
                        <LoginIcon />
                    </IconButton>
                )}
                {auth && (
                    <IconButton
                        size="large"
                        aria-label="account of current user"
                        aria-controls="menu-appbar"
                        aria-haspopup="true"
                        onClick={() => setCurrentPage(1)}
                        color="inherit"
                    >
                        <LogoutIcon />
                    </IconButton>
                )}
            </Toolbar>
          </AppBar>
          {currentPage == 0 ?
            <SearchConcert /> : <Grid></Grid>
          }

        </Box>
      );
};
export default Navbar;
